import {Component, OnDestroy, OnInit} from '@angular/core';
import {MatTableDataSource} from "@angular/material/table";
import {of, Subject, switchMap, takeUntil} from "rxjs";
import {ITask} from "../../core/interfaces/task";
import {TaskService} from "../../core/services/task.service";
import {MatDialog} from "@angular/material/dialog";
import {TaskAddEditComponent} from "../../shared/task-add-edit/task-add-edit.component";
import {ConfirmDeleteComponent} from "../../shared/confirm-delete/confirm-delete.component";

@Component({
  selector: 'app-backlog',
  templateUrl: './backlog.component.html',
  styleUrls: ['./backlog.component.scss']
})
export class BacklogComponent implements OnInit, OnDestroy{
  displayedColumns = ['id', 'name', 'issueType', 'epic', 'createdAt', 'actions'];

  dataSource = new MatTableDataSource<ITask>();

  sub$ = new Subject();

  constructor(
      private taskService: TaskService,
      public dialog: MatDialog,
  ) {

  }

  ngOnInit(): void {
  }
  getIssueTypes() {
    this.taskService.getTasks({
      isBacklog: true
    })
        .pipe(takeUntil(this.sub$))
        .subscribe(boards => {
          this.dataSource.data = boards;
        });
  }
  addBoard() {
    console.log('add board');
  }
  ngOnDestroy(): void {
  }

  deleteBoard(id: number) {
    const dialogRef = this.dialog.open(ConfirmDeleteComponent);

    dialogRef.afterClosed()
        .pipe(
            takeUntil(this.sub$),
            switchMap((result) => {
              if (result) {
                return this.taskService.deleteTask(id);
              }
              return of(null);
            })
        )
        .subscribe(result => {
          if (result) {
            this.getIssueTypes();
          }
        });
  }

  addTask(taskId?: number) {
    const  doalogRef = this.dialog.open(TaskAddEditComponent, {
      width: '1000px',
      data: {
        isBacklog: true,
        taskId,
      },
    });

    doalogRef.afterClosed().subscribe((task: ITask) => {
      if (task) {
        this.getIssueTypes()
      }
    })
  }
}
<div>
    <button mat-raised-button color="primary" (click)="addTask()">Add Task</button>
</div>


<div class="container">
    <table mat-table [dataSource]="dataSource" class="mat-elevation-z8">

        <!-- Name Column -->
        <ng-container matColumnDef="id">
            <th mat-header-cell *matHeaderCellDef> # </th>
            <td mat-cell *matCellDef="let element"> {{element.id}} </td>
        </ng-container>

        <!-- Name Column -->
        <ng-container matColumnDef="name">
            <th mat-header-cell *matHeaderCellDef> Name </th>
            <td mat-cell *matCellDef="let element"> {{element.name}} </td>
        </ng-container>
        <!-- Name Column -->
        <ng-container matColumnDef="issueType">
            <th mat-header-cell *matHeaderCellDef> Name </th>
            <td mat-cell *matCellDef="let element"> {{element.issueType.name}} </td>
        </ng-container>
        <!-- Name Column -->
        <ng-container matColumnDef="epic">
            <th mat-header-cell *matHeaderCellDef> Name </th>
            <td mat-cell *matCellDef="let element"> {{element.epic.name}} </td>
        </ng-container>

        <!-- Name Column -->
        <ng-container matColumnDef="createdAt">
            <th mat-header-cell *matHeaderCellDef> Created At </th>
            <td mat-cell *matCellDef="let element"> {{element.createdAt}} </td>
        </ng-container>

        <!-- Name Column -->
        <ng-container matColumnDef="actions">
            <th mat-header-cell *matHeaderCellDef>  </th>
            <td mat-cell *matCellDef="let element">
                <button mat-raised-button color="primary" (click)="addTask(element.id)">Edit</button>
                <button mat-raised-button color="warn" (click)="deleteBoard(element.id)">Delete</button>
            </td>
        </ng-container>


        <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
        <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
    </table>
</div>
